import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // BrowserRouter import for routing
import Home from './pages/Home'; // Import Home page
import MovieDetails from './pages/MovieDetails'; // Import MovieDetails page
import Navbar from './components/Navbar'; // Import Navbar
import Login from './pages/Login'; // Import Login page
import Register from './pages/Register'; // Import Register page

function App() {
  return (
    <Router>  {/* Wrap everything inside Router for routing */}
      <Navbar />  {/* Your Navbar component */}
      <Routes>
        <Route path="/" element={<Home />} />  {/* Home page route */}
        <Route path="/movies/:id" element={<MovieDetails />} />  {/* Movie details route */}
        <Route path="/login" element={<Login />} />  {/* Login page route */}
        <Route path="/register" element={<Register />} />  {/* Register page route */}
      </Routes>
    </Router>
  );
}

export default App;
